function App() {
  const expenses = [
    {
      id: "e1",
      title: "car insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e2",
      title: "Toilet paper",
      amount: 294.67,
      date: new Date(2020, 2, 28),
    },
    {
      id: "e4",
      title: "Iron Tools",
      amount: 294.67,
      date: new Date(2019, 2, 28),
    },
    {
      id: "e3",
      title: "New Desk",
      amount: 294.67,
      date: new Date(2022, 2, 28),
    },
  ];

  return (
    <div>
      <NewExpense />
      {/* <Expenses items={expenses} /> */}
    </div>
  );
}

export default App;
